  type: Class
  summary: "En samling <xref href=&quot;System.Web.Profile.ProfileInfo&quot;> </xref> objekt."
  remarks: "Ett ProfileInfoCollection-objekt innehåller <xref:System.Web.Profile.ProfileInfo>objekt som representerar användarprofiler från en datakälla.</xref:System.Web.Profile.ProfileInfo> En ProfileInfoCollection returneras från den <xref:System.Web.Profile.ProfileProvider.GetAllProfiles%2A>, <xref:System.Web.Profile.ProfileProvider.GetAllInactiveProfiles%2A>, <xref:System.Web.Profile.ProfileProvider.FindProfilesByUserName%2A>, och <xref:System.Web.Profile.ProfileProvider.FindInactiveProfilesByUserName%2A>metoder för <xref:System.Web.Profile.ProfileProvider>.</xref:System.Web.Profile.ProfileProvider> </xref:System.Web.Profile.ProfileProvider.FindInactiveProfilesByUserName%2A> </xref:System.Web.Profile.ProfileProvider.FindProfilesByUserName%2A> </xref:System.Web.Profile.ProfileProvider.GetAllInactiveProfiles%2A> </xref:System.Web.Profile.ProfileProvider.GetAllProfiles%2A>       En ProfileInfoCollection kan anges till den <xref:System.Web.Profile.ProfileProvider.DeleteProfiles%2A>metod för att ta bort profilinformation och egenskaper från datakällan.</xref:System.Web.Profile.ProfileProvider.DeleteProfiles%2A>"
  example:
  - "The following code example allows a user to search for profiles using the <xref:System.Web.Profile.SqlProfileProvider.FindProfilesByUserName%2A> and <xref:System.Web.Profile.SqlProfileProvider.FindInactiveProfilesByUserName%2A> methods. The user can pass the ProfileInfoCollection returned by the `find` methods to the <xref:System.Web.Profile.SqlProfileProvider.DeleteProfiles%2A> method to delete the associated profiles from the data source.  \n  \n [!code-vb[System.Web.Profile.SqlProfileProvider#4](~/add/codesnippet/visualbasic/t-system.web.profile.pro_3_1.aspx)]\n [!code-cs[System.Web.Profile.SqlProfileProvider#4](~/add/codesnippet/csharp/t-system.web.profile.pro_3_1.aspx)]"
